<!DOCTYPE html>
<html lang="pt-br">
<head>
  <meta charset="UTF-8" />
  <title>voc√™ √© bem corajosa</title>
  <style>
    body {
      background-color: #000;
      color: #f48fb1;
      font-family: 'Courier New', monospace;
      text-align: center;
      margin-top: 15%;
      padding: 0 15px;
    }
    #botao-coragem {
      background-color: transparent;
      border: 2px solid #f48fb1;
      color: #f48fb1;
      padding: 18px 36px;
      font-size: 20px;
      cursor: pointer;
      border-radius: 10px;
      transition: 0.3s;
    }
    #botao-coragem:hover {
      background-color: #f48fb1;
      color: #000;
    }
    #mensagem {
      margin-top: 30px;
      font-size: 26px;
      white-space: normal; /* permite quebra natural de linha */
      max-width: 320px;
      margin-left: auto;
      margin-right: auto;
      line-height: 1.5;
    }
    .typewriter {
      overflow: hidden;
      border-right: .15em solid #f48fb1;
      letter-spacing: .05em;
      display: block;
      max-width: 100%;
      margin: 0 auto 20px auto;
      white-space: nowrap; /* s√≥ na anima√ß√£o */
      width: fit-content;
      max-width: 100%;
    }
    @keyframes typing {
      from { width: 0 }
      to { width: 100% }
    }
    @keyframes blink-caret {
      from, to { border-color: transparent }
      50% { border-color: #f48fb1 }
    }
  </style>
</head>

    audio.src = "data:audio/mpeg;base64," + base64Audio;
    audio.load();

    const frase1 = "Gostei da sua coragem...";
    const frase2 = "Agora temos um encontro marcado no cinema üé¨üíñ";

    botao.addEventListener('click', () => {
      botao.style.display = 'none';
      mensagem.style.display = 'block';

      audio.play().catch(e => console.log(e));

      let i = 0;
      const digitarLinha1 = () => {
        if (i < frase1.length) {
          linha1.textContent += frase1.charAt(i);
          i++;
          setTimeout(digitarLinha1, 60);
        } else {
          linha1.style.borderRight = 'none';
          linha1.style.whiteSpace = 'normal';
          linha1.style.width = 'auto';

          setTimeout(() => {
            let j = 0;
            const digitarLinha2 = () => {
              if (j < frase2.length) {
                linha2.textContent += frase2.charAt(j);
                j++;
                setTimeout(digitarLinha2, 60);
              } else {
                linha2.style.borderRight = 'none';
                linha2.style.whiteSpace = 'normal';
                linha2.style.width = 'auto';
              }
            };
            digitarLinha2();
          }, 500);
        }
      };

      digitarLinha1();
    });
  </script>
